import React, { useEffect } from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Home from './home';
import Rental from './rent';
import SellPost from './sell_post';
import RentPost from './rent_post';
import DetailsPage from './sell_details';
import RentalDetails from './rent_details';
import Visit from './visit_home';
import VisitRent from './visit_rent';

function App() {
  useEffect(() => {
    // Retrieve the username from Django template
    const usernameFromDjango = document.getElementById('username').textContent;

    // Store the username in local storage
    localStorage.setItem('username', usernameFromDjango);
  }, []);

  return (
    <Router>
      <div className="App">
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/s/home" element={<Visit />} />
          <Route path="/details/:id" element={<DetailsPage />} />
          <Route path="/s/rental" element={<VisitRent />} />
          <Route path="/rental" element={<Rental />} />
          <Route path="/rental/:id" element={<RentalDetails />} />
          <Route path="/sell/post" element={<SellPost />} />
          <Route path="/rent/post" element={<RentPost />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
